hist_data = agg.rdd.flatMap(lambda x: x).histogram([1,2,3,4,5,7,10,15,25,40,65,100,math.inf])
# Plot of number of calls made 
pd.DataFrame(
    list(zip(*hist_data)), 
    columns=['bin', 'frequency']
).set_index(
    'bin'
).plot(kind='bar');

